import math


def fact_rho(N , f, init):
    x = init
    y = init
    d = 1
    while d==1:
        x = f(x)
        y = f(f(y))
        #print("Diff : ",abs(x-y))
        d = math.gcd(abs(x-y) , N)
    if d==N:
        return 0 
    
    return d



